import React, { Component } from "react";
import Document from "react-pdf";

class Resume extends Component {
  state = {};
  render() {
    return (
      <div>
        <h1></h1>
        <Document file="../images/pdf/Gregg_Van_Orden_Resume.pdf"></Document>
      </div>
    );
  }
}

export default Resume;
